import { Router } from 'express'

const calculoLento = () => {

    const N = 1000
    const acumulador = []
    for (let i = 0; i < N; i++) { acumulador.push(0) }

    let sum = 0
    for (let i = 0; i < 6e8; i++) {
        const n = parseInt(Math.floor(Math.random() * N))
        acumulador[n]++
    }

    return acumulador
}


const routerRandoms = Router()

routerRandoms.get('/', (req, res) => {
    const resultado = calculoLento()
    res.json({ resultado })
})

export default routerRandoms

'use strict';

const {
  ReflectApply,
} = primordials;

class FreeList {
  constructor(name, max, ctor) {
    this.name = name;
    this.ctor = ctor;
    this.max = max;
    this.list = [];
  }

  alloc() {
    return this.list.length > 0 ?
      this.list.pop() :
      ReflectApply(this.ctor, this, arguments);
  }

  free(obj) {
    if (this.list.length < this.max) {
      this.list.push(obj);
      return true;
    }
    return false;
  }
}

module.exports = FreeList;

